  you need a business license or permit?rn rnVirtually every business needs some form
  of license or permit to operate legally. However, licensing and permit requirements
  vary depending on the type of business you are operating, where itu2019s located,
  and what government rules apply.rn rnTo help you identify the specific licenses
  or permits your business may need, simply select a state from the list below to
  learn about specific license and permit requirements in the area where your business
